import React from 'react';

function Header({ user, setUser }) {
  return (
    <header className="header">
      <h1>Daily Lunch</h1>
      {user && (
        <button onClick={() => setUser(null)}>Logout</button>
      )}
      {user === 'admin' && (
        <button>Add Dish</button>
      )}
    </header>
  );
}

export default Header;
